 <div class="blog-v2-read-content blog-content">
 <h2>Introduction to server-side request forgery (SSRF)</h2>
<p><span>Web applications can trigger requests between HTTP servers. These are typically used to fetch remote resources, such as software updates, or to import metadata from a URL or another web application. Such inter-server requests are not dangerous in general, but unless implemented correctly, they can make a server vulnerable to server-side request forgery, or SSRF.</span></p>
<p>An SSRF vulnerability is introduced when <a href=https://www.netsparker.com/blog/web-security/input-validation-errors-root-of-all-evil/ rel=noreferrer>user-controllable data</a> is used to build the target URL. To perform an SSRF attack, an attacker can then change a parameter value in the vulnerable web application to create or control requests from the vulnerable server.</p>
<p>External resources accessed by a web application may include <span>internal services, for example an RSS feed from another website. A</span> developer might use the following URL to <span>retrieve a remote feed:</span></p>
<pre><code>https://example.com/feed.php?url=externalsite.com/feed/to</code> </pre>
<p>If the attacker is able to change the <code>url</code> parameter to <code>localhost</code> (the loopback interface), this may allow them to view local resources hosted on the server, making it vulnerable to server-side request forgery.</p>
<p>If attackers can control the destination of server-side requests, this opens up a whole array of offensive activities, potentially allowing them to:</p>
<ul>
<li>Abuse the trust relationship between the vulnerable server and other systems</li>
<li>Bypass IP whitelisting</li>
<li>Bypass host-based authentication services</li>
<li>Read web resources and other useful assets that are not accessible to the public, for instance metadata APIs in AWS environments or <span><code>trace.axd</code> in ASP.NET </span></li>
<li>Perform port scans on the internal network that the server is connected to</li>
<li>Read files from the web server</li>
<li>View status pages and interact with APIs as the web server</li>
<li>Retrieve sensitive information such as the IP address of a web server running behind a reverse proxy</li>
</ul>
<h2>SSRF in the OWASP Top 10</h2>
<p>Server-side request forgery is a well-known vulnerability and a regular item on the <a href=https://owasp.org/ rel=noreferrer>Open Web Application Security Project<span>’</span>s</a> list of top ten web application security risks. In the <a href=https://www.netsparker.com/blog/web-security/what-owasp-top-ten-2021-categories-mean/ rel=noreferrer>OWASP Top 10 for 2021</a>, it has even (for the first time) received its own category as <span>A10:2021 – Server-Side Request Forgery (SSRF). It was included as a separate category based on the results of a community survey.</span></p>
<p><span>As modern web applications get more complex and interconnected, fetching a URI has become a fundamental operation for delivering content and functionality. With the rise in server-side requests, SSRF vulnerabilities have also become more common. At the same time, their scope and impact are expanding due to the growing prevalence of cloud services and intricate cloud-based application architectures, which can allow attackers to access web infrastructures and cloud data sources via a compromised server.</span></p>
<h2>Typical exploitation of a server-side request forgery vulnerability</h2>
<p>In a typical SSRF scenario, an external attacker who wants to access an internal server can<span>’</span>t use direct requests because they would be blocked by the firewall. Instead, malicious actors can exploit an SSRF vulnerability to make their attack via a vulnerable web server:</p>
<ol>
<li>The attacker sends a forged request to a web server that is vulnerable to SSRF and resides on the same internal network as the target server.</li>
<li>The vulnerable web server sends the attacker-controlled request to the victim’s server, bypassing the firewall.</li>
<li>The victim’s server responds to the web server with the requested data.</li>
<li>If the specific SSRF vulnerability permits it, the data is sent back to the attacker. In most cases, the attacker will need to exfiltrate or infer this information by other means (out-of-band).</li>
</ol>
<p style=text-align:center><span><a data-toggle=modal data-target=#lightbox class=zcursor href=#><img src=data:image/png;base64, alt="A typical exploitation of a Server-Side Request Forgery vulnerability" width=500></a></span></p>
<h2>Why is server-side request forgery dangerous?</h2>
<p>While many web vulnerabilities directly affect the target system, SSRF allows attackers to use the target as an intermediary that passes requests to a third system. So while an SSRF attack might not be damaging in itself, it can provide malicious hackers with access to internal systems that were never supposed to be accessible from the Internet. There are several reasons why this is dangerous.</p>
<h3>SSRF abuses the trust relationship between internal systems</h3>
<p>As a security best practice, you should always keep your attack surface as small as possible on all levels. In internal networks, this usually means that access to certain ports or actions is restricted to specific whitelisted machines only. To maintain security while still being able to exchange data and perform administrative tasks, servers often have a <i>trust relationship</i> with select other machines.</p>
<p>At a network level, this trust can mean that a firewall only allows access to certain ports if the requesting machine is on the same local network or if its IP address is explicitly trusted. At a software level, you can have implicit trust in local machines so that authentication is not required for some administrative tasks as long as the IP is 127.0.0.1 or perhaps inside the internal network. This adds some degree of physical security because even if an attacker obtains valid credentials, they can<span>’</span>t log in without access to the local network.</p>
<p>By exploiting an SSRF vulnerability, an attacker can circumvent such restrictions to interact with other servers that trust the affected machine. This could mean sending data queries or crafting malicious requests to interact with ports that aren’t accessible from the outside network. By forging server-side requests, an external attacker can perform malicious actions on the target server that would otherwise not be possible from the outside.</p>
<h3>SSRF allows attackers to scan local or external networks</h3>
<p>By exploiting a server-side request forgery vulnerability, attackers may be able to scan local or external networks that the vulnerable server is connected to. While it is usually not possible to extract data directly, attackers can use the page load time, error messages, or banners of the service they are probing to indirectly determine whether the targeted service is responding or a tested port is open.</p>
<h4>Example: How to scan a network via an SSRF vulnerability</h4>
<p>Imagine you have a website with a service that allows you to fetch JPEG images from a remote source so it can determine their dimensions. As a security control, the service checks if <span>the response received from the remote source has </span>a <code>Content-Type</code> HTTP header with the value <code>image/jpeg</code>. If the header is missing or specifies a different content type, the service assumes that a different image format was provided and returns the error message <em>Please provide JPEG images only</em>. If there is a problem connecting to the remote source, the service returns <em>No image found!</em></p>
<p>Let’s see how attackers can use different inputs that affect the service response to determine if a host is up or not:</p>
<ul>
<li>If we request <code>https://victim.com/image.php?url=https://example.com/picture.jpg</code>, we get the height and width of the image, meaning that this is a valid picture with a correct <code>Content-Type</code> header.</li>
<li>Let’s try a different HTTP request and feed the server an HTML file rather than an image by sending <code>https://victim.com/image.php?url=https://example.com/index.html</code>. Now the service response is <em>Please provide JPEG images only</em>, since the supplied page has the wrong <code>Content-Type</code> header (<code>text/html</code> instead of <code>image/jpeg</code>).</li>
<li>Now let’s see what happens for an invalid URL such as <code>https://victim.com/image.php?url=https://example.invalid/</code>. The service returns <em>Image not found</em>, meaning there was an error fetching the remote resource.</li>
</ul>
<p>Now that we know how the application behaves for different inputs, we can try to abuse it. We know that a valid URL with a missing or incorrect <code>Content-Type</code> header returns the error <em>Please provide jpeg images only</em>. <span>Let’s send </span>the following request with an internal URL:</p>
<pre><code>https://victim.com/image.php?url=127.0.0.1:3306</code></pre>
<p>If we get the error <em>Image not found</em>, that means there is no response from host 127.0.0.1 on port 3306. However, if we get <em>Please provide jpeg images only</em>, it means that the internal server did respond, so there is a service running on that port. That way, we can use the vulnerable web application to probe different internal IP addresses and ports to make a complete scan. In effect, such an SSRF vulnerability allows attackers to perform port scanning without using an actual port scanner.</p>
<h3>SSRF can expose files and internal resources on the server</h3>
<p>When the content of a remote resource is directly rendered to a page, there is a possibility that attackers could read file content. As an example, consider a web service that removes all images from a supplied URL and then nicely formats the text. To do this, it takes the response body for a given URL and then applies text formatting.</p>
<p>If the service is vulnerable to SSRF and allows us to supply a <code>file://</code> URL instead of the usual <code>http://</code> or <code>https://</code>, we can use it to read files from the local file system. For example, if we use the URL <code>file:///etc/passwd</code> on a UNIX-based system, we could display the content of the <em>passwd</em> file. The same technique can be used to view the source code of the vulnerable web application.</p>
<h2>What are the potential impacts of SSRF attacks?</h2>
<p>As seen in the above examples, the direct impact of exploiting a server-side request forgery vulnerability is nearly always information disclosure because attackers obtain a lot of useful information about systems and resources that should be inaccessible to them. However, the indirect consequences can be devastating, since SSRF can allow malicious actors to:</p>
<ul>
<li>Use the vulnerable server as a port and IP scanner for internal and external systems</li>
<li>Interact with protocols such as Gopher (if enabled) to perform additional reconnaissance</li>
<li>Discover the IP addresses of servers running behind a reverse proxy</li>
<li>Obtain remote code execution</li>
</ul>
<p>Because SSRF is primarily an access channel for further probes and attacks, there are also many other possibilities, depending on <span>how the vulnerable web application uses responses received from the remote resource. Combined with other vulnerabilities in suitable conditions, SSRF can have </span>severe consequences.</p>
<h2>Preventing server-side request forgery</h2>
<p>To prevent SSRF vulnerabilities in your web applications, you are strongly advised to use a whitelist of allowed domains and protocols for remote resources fetched by the web server. More generally, you should also avoid using user input directly in any functions that can make requests on behalf of the server. While it is always a good idea to sanitize and filter user input, you should not rely on this as your sole protection because it is virtually impossible to cover all the different scenarios.</p>
<p>Attackers can use a wide variety of tricks to bypass URL filtering:</p>
<ul>
<li>Use encoded IP addresses which will be translated to an IP in an internal network:</li>
<ul>
<li>1 -&gt; same as localhost</li>
<li>123.123.123 -&gt; same as localhost</li>
</ul>
<li>Supply hostnames that resolve to internal IP addresses</li>
<li>Bypass host blacklisting by applying dots at the end of the hostname</li>
</ul>
<p>This is only a small portion of bypasses that attackers have in their arsenal, so recommended practice is to avoid user input in functions that issue requests on behalf of the server.</p>
<h2>Identifying SSRF vulnerabilities in your web applications</h2>
<p>Modern dynamic application security testing (<a href=https://www.netsparker.com/blog/web-security/netsparker-shows-how-to-do-dast/ rel=noreferrer>DAST</a>) solutions such as Netsparker provide accurate vulnerability scanning for a wide variety of web vulnerabilities, including <a href="https://www.netsparker.com/web-vulnerability-scanner/vulnerabilities/?title=server-side+request+forgery" rel=noreferrer>many server-side request forgery vulnerabilities</a>. For out-of-band SSRF and other second-order vulnerabilities, Netsparker uses a <a href=https://www.netsparker.com/blog/docs-and-faqs/netsparker-hawk-detects-ssrf-out-of-band-vulnerabilities/ rel=noreferrer>dedicated vulnerability testing infrastructure</a> that allows it to identify and report security flaws that don<span>’</span>t return direct responses.</p>
